USE residex;


UPDATE transaction t
	JOIN
    booking b ON t.booking_id = b.id
    JOIN 
    listing l ON b.listing_id = l.id
SET 
    actual_price = l.rate_per_day,
    no_days =  b.no_of_days,
    company_charge = (l.rate_per_day * b.no_of_days)*5/100,
    host_charge = (l.rate_per_day * b.no_of_days),
    total_price = (l.rate_per_day * b.no_of_days)+(l.rate_per_day * b.no_of_days)*5/100
    ;
